class Solution:
    def longestPrefix(self, s: str) -> str:
        n = len(s)
        p = s[:n-1]
        s = "".join(reversed(s[1:]))
        prefix_h = sum(ord(s[i]) for i in range(n - 1))
        suffix_h = sum(ord(s[n - i - 1]) for i in range(n - 1))
        for i in range(n - 2, -1, -1):
            if prefix_h == suffix_h:
                if (p := s[:i + 1]) == s[n - i - 1:]:
                    return p
            prefix_h -= ord(s[i])
            suffix_h -= ord(s[n - i - 1])
        return ""


